function dropDown(){document.getElementById("navbar_dropdown_btn").classList.toggle("show")}window.onclick=function(n){if(!n.target.matches(".navbar_dropdown_btn")){let n,t=document.getElementsByClassName("navbar_def_dropdown_btn_content");for(n=0;n<t.length;n++){let o=t[n];o.classList.contains("show")&&o.classList.remove("show")}}};